import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import style from './ProjectSubNav.module.css';

const ProjectSubNav = (props) => {
	let projects = props.data.projects.edges;
	console.log(projects);

	let content;

	const { loading, error, data, client } = useQuery(GET_PROJECTS);

	content = (
		<div>
			{projects.map((project) => (
				<NavLink
					to={`/project/${project.node.slug}/`}
					onClick={props.handleClick}
					onMouseOver={() =>
						client.query({
							query: GET_PROJECTS,
							variables: { slug: project.node.slug },
						})
					}
				>
					{project.node.title}
				</NavLink>
			))}
		</div>
	);

	return <div>{content}</div>;
};

export default ProjectSubNav;
